import { useHistory } from "react-router";
import "./Search.css"
import { useState, useEffect } from "react"
import Axios from "axios"
import {useLayoutEffect} from  "react"
import TextField from "@material-ui/core/TextField";
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';




let options = []

function Search() {
    let [selectedOption, setSelectedOption] = useState(null);
    let [cars, setCars] = useState([null])
    let [colors, setColors] = useState(null)

    useEffect(() => {
        Axios.get('http://localhost:3001/auto', {
        }).then(async (response) => {
                await setCars(response.data.cars)
                await setColors(response.data.colors)
                for (let i = 0; i < response.data.cars[0].length; i++) {
                    options.push({label: cars[0][i].name, value: cars[0][i].name})
                }
        })
}, [])


    return (
        <div>
        <FormControl sx={{ m: 1, minWidth: 80 }}>
          <InputLabel id="demo-simple-select-autowidth-label">Auto</InputLabel>
          <Select
            labelId="demo-simple-select-autowidth-label"
            id="demo-simple-select-autowidth"
            autoWidth
            options={options}
          >
          </Select>
        </FormControl>
      </div>
    );
}

  export default Search;
